import { drizzleReactHooks } from '@drizzle/react-plugin';
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const { useDrizzle } = drizzleReactHooks;

const Daopropose2 = ({ traductores, longitud }) => {
  const { useCacheCall } = useDrizzle();

  const [selectedOption, setSelectedOption] = useState('');
  const [selectedData2Option1, setSelectedData2Option1] = useState('');
  const [selectedData2Option2, setSelectedData2Option2] = useState('');
  const [textInput1, setTextInput1] = useState('');
  const [textInput2, setTextInput2] = useState('');
  const [selectedTraductorName, setSelectedTraductorName] = useState('');

  const handleChangeOption1 = (event) => {
    const selectedIndex = event.target.selectedIndex;
    setSelectedOption('option1');
    setSelectedData2Option1(traductores[selectedIndex - 1]?.data2 || '');
    setSelectedTraductorName(traductores[selectedIndex - 1]?.data1 || '');
  };

  const handleChangeOption2 = (event) => {
    const selectedIndex = event.target.selectedIndex;
    setSelectedOption('option2');
    setSelectedData2Option2(traductores[selectedIndex - 1]?.data2 || '');
    setSelectedTraductorName(traductores[selectedIndex - 1]?.data1 || '');
  };

  // Check if the form is filled whenever any of the input values change
  useEffect(() => {
    const isDropdownFilled = selectedOption !== '';
    const isTextInput1Filled = textInput1.trim() !== '';
    const isTextInput2Filled = textInput2.trim() !== '';

    setIsFormFilled(isDropdownFilled && isTextInput1Filled && isTextInput2Filled);

    // Update document title when the dropdown value changes
    document.title = selectedTraductorName !== '' ? `Selected Traductor: ${selectedTraductorName}` : 'Daopropose2';
  }, [selectedOption, textInput1, textInput2, selectedTraductorName]);

  return (
    <div>
      <form>
        <label>
          Selecciona una opción:
          <select value={selectedOption} onChange={(event) => setSelectedOption(event.target.value)}>
            <option value="">Seleccionar</option>
            {Array.from({ length: longitud }, (_, i) => (
              <option key={i} value={traductores[i]?.data1}>
                {traductores[i]?.data1}
              </option>
            ))}
          </select>
        </label>
      </form>

      {selectedOption === 'option1' && (
        <div>
          <p>Desplegable:</p>
          <form>
            <label>
              Selecciona un traductor:
              <select value={selectedData2Option1} onChange={handleChangeOption1}>
                <option value="">Seleccionar</option>
                {Array.from({ length: longitud }, (_, i) => (
                  <option key={i} value={traductores[i]?.data1}>
                    {traductores[i]?.data1}
                  </option>
                ))}
              </select>
            </label>
          </form>
        </div>
      )}

      {selectedOption === 'option2' && (
        <div>
          <p>Desplegable:</p>
          <form>
            <label>
              Selecciona un traductor:
              <select value={selectedData2Option2} onChange={handleChangeOption2}>
                <option value="">Seleccionar</option>
                {Array.from({ length: longitud }, (_, i) => (
                  <option key={i} value={traductores[i]?.data1}>
                    {traductores[i]?.data1}
                  </option>
                ))}
              </select>
            </label>
          </form>
        </div>
      )}

      <div>
        <p>Casilla de texto 1:</p>
        <input
          type="text"
          value={textInput1}
          onChange={(e) => setTextInput1(e.target.value)}
        />
        <p>Casilla de texto 2:</p>
        <input
          type="text"
          value={textInput2}
          onChange={(e) => setTextInput2(e.target.value)}
        />
      </div>

      {selectedOption === 'option1' && <p>data2 de la opción seleccionada: {selectedData2Option1}</p>}
      {selectedOption === 'option2' && <p>data2 de la opción seleccionada: {selectedData2Option2}</p>}

      <button disabled={!isFormFilled}>Submit</button>
    </div>
  );
};

export default Daopropose2;
